// Navbar.js
import React from "react";
import { Link } from "react-router-dom";

function Navbar() {
  return (
    <nav className="bg-green-700 text-white shadow-md fixed w-full top-0 z-50">
      <div className="container mx-auto flex justify-between items-center p-4">
        <h1 className="text-xl font-bold">üê∂ Bela's Paw's</h1>
        <div className="space-x-6">
          <Link to="/" className="hover:text-pink-300">Home</Link>
          <Link to="/about" className="hover:text-pink-300">About</Link>
          <Link to="/services" className="hover:text-pink-300">Services</Link>
          <Link to="/gallery" className="hover:text-pink-300">Gallery</Link>
          <Link to="/reviews" className="hover:text-pink-300">Reviews</Link>
          <Link to="/contact" className="hover:text-pink-300">Contact</Link>
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
